import * as React from "react";

export const Terminal = () => {
  return <Textbox />;
};

function Textbox() {
  return (
    (
      <table className="terminalbody">
        <tr></tr>
        <tr>
          <td>&ndsp</td>
          <td></td>
          <td></td>
        </tr>
        <tr></tr>
      </table>
    ),
    (<textarea width="100%" height="100px"></textarea>)
  );
}
